def ver():
    def borrar_usuario(event=None):  # Añadir event=None para que la función pueda ser llamada sin un evento
        # Obtener el índice del elemento seleccionado en la Listbox
        seleccion = listbox.curselection()
        if not seleccion:
            return
        
        # Obtener el nombre del usuario seleccionado
        nombre_usuario = usuarios[seleccion[0]][1]
        
        # Eliminar al usuario seleccionado de la base de datos
        with sqlite3.connect("datos.db") as connect:
            cursor = connect.cursor()
            cursor.execute("DELETE FROM Correos WHERE Nombre=?", (nombre_usuario,))
            cursor.execute("DELETE FROM Nombres WHERE Nombre=?", (nombre_usuario,))
            connect.commit()
        
        # Actualizar la Listbox después de eliminar al usuario
        listbox.delete(seleccion[0])
        
    ventana_ver = tk.Toplevel(root)
    ventana_ver.title("")
    ventana_ver.geometry("400x400")  

    ventana_ver.tk.call("wm", "iconphoto", ventana_ver._w, icono_tk)
    
